import React from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import { Routes } from './routes';
import { AuthProvider, useAuth } from './context/AuthContext';

// Pages
import Alunos from './pages/Alunos';
import Individual from './pages/Individual';
import Turmas from './pages/Turmas';
import Treinos from './pages/Treinos';
import Agendamentos from './pages/Agendamentos';
import Login from './pages/Login';
import Cadastrar from './pages/Cadastrar';
import Perfil from './pages/Perfil';

// Components
import Sidebar from './components/Sidebar';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Preloader from './components/Preloader';

const PrivateRoute = ({ component: Component, ...rest }) => {
  const { isAuthenticated } = useAuth();
  return (
    <Route
      {...rest}
      render={props =>
        isAuthenticated ? (
          <Component {...props} />
        ) : (
          <Redirect to={Routes.Login.path} />
        )
      }
    />
  );
};

const App = () => {
  return (
    <AuthProvider>
      <Router>
        <Sidebar />
        <main className="content">
          <Navbar />
          <Preloader />
          <Switch>
            <Route exact path={Routes.Login.path} component={Login} />
            <Route exact path={Routes.Cadastrar.path} component={Cadastrar} />
            <PrivateRoute exact path={Routes.Perfil.path} component={Perfil} />
            <PrivateRoute exact path={Routes.Alunos.path} component={Alunos} />
            <PrivateRoute exact path={Routes.Individual.path} component={Individual} />
            <PrivateRoute exact path={Routes.Turmas.path} component={Turmas} />
            <PrivateRoute exact path={Routes.Treinos.path} component={Treinos} />
            <PrivateRoute exact path={Routes.Agendamentos.path} component={Agendamentos} />
            <Redirect to={Routes.NotFound.path} />
          </Switch>
          <Footer />
        </main>
      </Router>
    </AuthProvider>
  );
};

export default App;
